import React from 'react';

const App = () => {
  return (
    <div>
      <h2>Course Goals</h2>
      <ul className="">
        <li>Finish the Course</li>
        <li>Learn all about the Course Main Topic</li>
        <li>Help other student in the Course Q&amp;A</li>
      </ul>
    </div>
  );
};



export default App;
